import React from 'react';
import { List, Surface } from 'react-native-paper';
import { StyleSheet } from 'react-native';
export const Hospitais = () => {

    const listaHospital = [
        {
            title: "S達o Luiz",
            description: "R. Francisco Marengo, 1312 - Jardim Analia Franco, S達o Paulo - SP, 03313-001"
        }
    ]

    return (
        listaHospital.map((item, index) => (
            <Surface key={index} style={styles.surface}>
                <List.Item
                    title={item.title}
                    description={item.description}
                    left={props => <List.Icon {...props} icon="hospital" />}
                />
            </Surface>
        ))

    )
}

const styles = StyleSheet.create({
    surface: {
        padding: 5,
        margin: 10,
        height: 80,
        alignItems: 'center',
        justifyContent: 'center',
        elevation: 4,
    },
});
